import React, { Component } from 'react';
import UsersSquares from '../usersSquares/UsersSquares';
import GenderFilterPanel from '../../components/genderFilterPanel/GenderFilterPanel';
import QueryFilterPanel from '../../components/queryFilterPanel/QueryFilterPanel';
import User from '../../models/User';
import { store } from '../../redux/Store';
import './home.css';
import { ActionType } from '../../redux/ActionType';


interface usersState {
    allUsers : User[];
    filteredUsers : User[];
}

export default class Home extends Component <any, usersState> {

    constructor(props : any) {
        super(props);

        this.state = {
            allUsers: new Array <User> (),
            filteredUsers : new Array <User> ()
        };

        store.dispatch({
            type: ActionType.GetAllUsers,
            payload: this.state.allUsers
        });
    }

    componentDidMount = () => {
        const users : User[] = [
            new User("Ben Ashkenazi", 23, "Male", false),
            new User("Ben Ashkenazi", 23, "Male", true),
            new User("Ben Ashkenazi", 23, "Male", false),
            new User("Ben Ashkenazi", 23, "Male", false),
            new User("Ben Ashkenazi", 23, "Male", true),
            new User("Ben Ashkenazi", 23, "Male", false),
            new User("Ben Ashkenazi", 23, "Male", true),
        ];

        this.setState({
            allUsers: users,
            filteredUsers: users
        });
    }


    render() {
        return (
            <div className="home">
                <GenderFilterPanel />
                <QueryFilterPanel />
                <UsersSquares filteredUsers={this.state.filteredUsers} />
            </div>
        )
    }
}
